import React from 'react'

function Main() {
const userId = sessionStorage.getItem("UserSession");
  useEffect(()=>{
    fetch(`/api/caregivers/${userId}/elder-list`)
    .then(response => response.json())
    .then(elders => {
      console.log(elders); // Do something with the retrieved car list
    })
    .catch(error => console.error(error));
  }, [])
  
  return (
    <div>Main</div>
  )
}

export default Main
